(function($){$.fn.clickToggler=function(){var argArray=Array.prototype.slice.call(arguments);if(!jQuery.isFunction(argArray[0])){if(argArray[0].el){argArray[0].context=argArray[0].el}var settings=$.extend({classBinder:false,primer:false,context:this},argArray[0]);argArray.splice(0,1)}else{var settings={classBinder:false,primer:false,context:this}}if(settings.classBinder){var expres=settings.classBinder}return this.each(function(){var $this=$(this);var click_num=[];for(var i=0;i<argArray.length;i++){j=i+1;if(j>argArray.length-1){if(settings.primer&&$.isNumeric(settings.primer)){$this.data("primed",true);j=settings.primer}else{j=0}}click_num[i]=function(i,j){return function(){if(settings.classBinder&&!$this.data("togFiring")){$(expres).each(function(){while($(this).data("togFiring")){if($(this)!=$this){$(this).trigger("click")}}})}if(settings.primer){if(i==0||j==settings.primer){$this.data("togFiring",true)}if(j==0||i==settings.primer){$this.data("togFiring",false)}}else{if(i==0){$this.data("togFiring",true)}if(j==0){$this.data("togFiring",false)}}argArray[i].call($(settings.context),settings,this);$this.off("click",click_num[i]);$this.on("click",click_num[j])}}(i,j)}$this.on("click",click_num[0])})}})(jQuery);